// DeleteUniqueIndexCache 删除索引存在的缓存
func (a *AiAudioRecordRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.AiAudioRecord) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, a.cache.Key(CacheAiAudioRecordByConditionPrefix))
	keys = append(keys, a.cache.Key(CacheAiAudioRecordUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[a.cache.Key(CacheAiAudioRecordByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiAudioRecordUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiAudioRecordByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiAudioRecordUnscopedByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiAudioRecordByPlatformPrefix, item.Platform)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiAudioRecordUnscopedByPlatformPrefix, item.Platform)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiAudioRecordByTenantIDPrefix, item.TenantID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiAudioRecordUnscopedByTenantIDPrefix, item.TenantID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := a.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
